import React from "react";
import "./App.css";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Registration from "./pages/Registration";

function App() {
  return (
    <>
      <Router>
        <Route path="/" element={<Registration></Registration>}></Route>
      </Router>
    </>
  );
}

export default App;
